import React, { Component } from 'react';
import { Grid, Cell } from 'react-mdl';

class WelcomePage extends Component {
    render() {
        return (

            <div styles={{ width: '100%', margin: 'auto' }}>
                <Grid className="welcomepage-grid">
                    <Cell col={12}>
                        <img
                            src="https://www.google.com/imgres?imgurl=https%3A%2F%2Fcdn.clipart.email%2F3b1b3ed68a61b7c1a9bc95de30b6a622_man-playing-guitar-silhouette-at-getdrawingscom-free-for-_852-480.jpeg&imgrefurl=https%3A%2F%2Fwww.clipart.email%2Fclipart%2Fguy-playing-guitar-silhouette-109877.html&tbnid=tBOW_M59kap8OM&vet=12ahUKEwj2hMS448zpAhVPk0sFHWX-BFsQMyhAegUIARCQAQ..i&docid=lY4W5MX9MO13eM&w=852&h=480&q=guitarist%20boy%20avatar&ved=2ahUKEwj2hMS448zpAhVPk0sFHWX-BFsQMyhAegUIARCQAQ"
                        />

                    </Cell>
                </Grid>
            </div>

        );

    }
}

export default WelcomePage;
